import React from 'react'
import { StyleSheet, Text, View } from 'react-native'
import { Input } from 'react-native-elements'
import { PaymentCardProps } from './types'

const SubscriptionCharge = (props: PaymentCardProps) => {
    return (
        <View>
            <View style={styles.otherPriceContainer}>
                    <Text style={{alignSelf:"center"}}>구매하실 포인트를 입력해주세요</Text>
                    <Input
                        placeholder="10"
                        style={{alignSelf:'center'}}
                        keyboardType='number-pad'
                    />
                </View>
        </View>
    )
}

export default SubscriptionCharge

const styles = StyleSheet.create({
    otherPriceContainer:{
        width:190,
        height:90,
        borderBottomColor:"#00000030",
        justifyContent: 'center',
        alignItems:'center',
        alignSelf:'center'
    }
})
